import React from "react";
import '../style.css';

class Header extends React.Component{
  render(){
    return (
      <header id = "bg2">
        <img src="http://razzlers.me:8080/Razzlers_files/Razzlers-Logo.png" height = "80"/>
        <div right = "0">
          <button
            className="button"
            type="button">
              Log In
          </button>
          <button
            className="button"
            type="button">
              Sign Up
          </button>
        </div>
      </header>
    )
  }
}
export default Header
